<!DOCTYPE html>
<html>
<head>
<style>
body{
    margin:0;
    background:black;
    overflow:hidden;
}
.space{
    position:relative;
    width:100%;
    height:100vh;
    background:url("https://images.pexels.com/photos/998641/pexels-photo-998641.jpeg?cs=srgb&dl=pexels-francesco-ungaro-998641.jpg&fm=jpg") center/cover no-repeat;
}
.rocket{
    position:absolute;
    width:120px;
    bottom:20px;
    left:20px;
    animation:fly 7s linear infinite;
}
.astronaut{
    position:absolute;
    width:150px;
    top:30%;
    right:10%;
    animation:float 4s ease-in-out infinite;
}
@keyframes fly{
    0%{transform:translate(0,0);}
    100%{transform:translate(900px,-600px);}
}
@keyframes float{
    0%{transform:translateY(0);}
    50%{transform:translateY(-30px);}
    100%{transform:translateY(0);}
}
</style>
